selector_to_html = {"a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/8510070..png\"><img alt=\"../../media/8510070..png\" src=\"../../media/8510070..png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">\u0644\u0627 \u064a\u0648\u062c\u062f \u0641\u0627\u0635\u0644 \u0632\u0645\u0646\u064a</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#scanning-interval\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u0627\u0644\u0641\u0627\u0635\u0644 \u0627\u0644\u0632\u0645\u0646\u064a \u0644\u0644\u0641\u062d\u0635<a class=\"headerlink\" href=\"#scanning-interval\" title=\"Link to this heading\">#</a></h2><p>\u062a\u0623\u062e\u064a\u0631 \u0627\u0644\u0639\u0645\u0644 \u0639\u0646\u062f \u0645\u0633\u062d \u0631\u0645\u0648\u0632 \u0645\u062e\u062a\u0644\u0641\u0629</p>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">\u0648\u0636\u0639 \u0627\u0644\u0645\u0633\u062d<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>\u0648\u0636\u0639 \u0645\u0634\u063a\u0644 \u0627\u0644\u0645\u0641\u062a\u0627\u062d<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>\u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0627\u0644\u0632\u0631 \u0644\u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a\u060c \u0648\u062a\u062d\u0631\u064a\u0631 \u0627\u0644\u0632\u0631 \u0644\u0625\u0646\u0647\u0627\u0621 \u0627\u0644\u0645\u0633\u062d. \u064a\u0646\u062a\u0647\u064a \u0627\u0644\u0628\u062d\u062b \u0639\u0646\u062f\u0645\u0627 \u064a\u0643\u0648\u0646 \u0627\u0644\u0641\u062d\u0635 \u0646\u0627\u062c\u062d\u0627\u064b \u0623\u0648 \u064a\u062a\u062c\u0627\u0648\u0632 \u0648\u0642\u062a \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0648\u0642\u062a \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0648\u0627\u062d\u062f\u0629.</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../media/8610020..png\"><img alt=\"../../media/8610020..png\" src=\"../../media/8610020..png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">`*' \u0648\u0636\u0639 \u0645\u0634\u063a\u0644 \u0627\u0644\u0645\u0641\u062a\u0627\u062d</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u0648\u0636\u0639 \u0627\u0644\u0625\u0633\u062a\u0634\u0639\u0627\u0631 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>\u0641\u064a \u0648\u0636\u0639 \u0627\u0644\u0627\u0633\u062a\u0634\u0639\u0627\u0631 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u060c \u0633\u0648\u0641 \u064a\u0643\u062a\u0634\u0641 \u0627\u0644\u0645\u0627\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0633\u0637\u0648\u0639 \u0627\u0644\u0628\u064a\u0626\u0629 \u0627\u0644\u0645\u062d\u064a\u0637\u0629. \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u063a\u064a\u0631 \u0627\u0644\u0633\u0637\u0648\u0639\u060c \u064a\u062a\u0645 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0645\u0633\u062d. \u064a\u0646\u062a\u0647\u064a \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0639\u0646\u062f\u0645\u0627 \u064a\u0646\u062c\u062d \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0623\u0648 \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u062c\u0627\u0648\u0632 \u0648\u0642\u062a \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0648\u0642\u062a \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0648\u0627\u062d\u062f. \u0648\u0628\u0635\u0631\u0641 \u0627\u0644\u0646\u0638\u0631 \u0639\u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0623\u062e\u064a\u0631 \u0646\u0627\u062c\u062d\u0627\u064b \u0623\u0648 \u0641\u0627\u0634\u0644\u0627\u064b\u060c \u0633\u064a\u062a\u0645 \u0627\u0643\u062a\u0634\u0627\u0641 \u0633\u0637\u0648\u0639 \u0627\u0644\u0628\u064a\u0626\u0629 \u0627\u0644\u0645\u062d\u064a\u0637\u0629 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649.</p>", "a[href=\"#ms\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">500 \u0645\u0644\u064a<a class=\"headerlink\" href=\"#ms\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0645\u0633\u062a\u0645\u0631<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>\u064a\u0639\u0645\u0644 \u0627\u0644\u0645\u0627\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0628\u0627\u0633\u062a\u0645\u0631\u0627\u0631. \u0625\u0630\u0627 \u0646\u062c\u062d \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0623\u0648 \u062a\u062c\u0627\u0648\u0632 \u0648\u0642\u062a \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0648\u0642\u062a \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0648\u0627\u062d\u062f\u060c \u064a\u0646\u062a\u0647\u064a \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a \u0627\u0644\u062d\u0627\u0644\u064a. \u0625\u0630\u0627 \u062a\u062c\u0627\u0648\u0632 \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0645\u062d\u062f\u062f \u060c \u064a\u062a\u0645 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0641\u062d\u0635 \u0627\u0644\u062a\u0627\u0644\u064a \u062a\u0644\u0642\u0627\u0626\u064a\u0627\u064b.</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/8610028..png\"><img alt=\"../../media/8610028..png\" src=\"../../media/8610028..png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">\u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0645\u0633\u062a\u0645\u0631</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/851007500..png\"><img alt=\"../../media/851007500..png\" src=\"../../media/851007500..png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">500 \u0645\u0644\u064a</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#no-time-interval\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">\u0644\u0627 \u064a\u0648\u062c\u062f \u0641\u0627\u0635\u0644 \u0632\u0645\u0646\u064a<a class=\"headerlink\" href=\"#no-time-interval\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/8610023..png\"><img alt=\"../../media/8610023..png\" src=\"../../media/8610023..png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">\u0648\u0636\u0639 \u0627\u0644\u0625\u0633\u062a\u0634\u0639\u0627\u0631 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u0648\u0636\u0639 \u0645\u0634\u063a\u0644 \u0627\u0644\u0645\u0641\u062a\u0627\u062d<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>\u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0627\u0644\u0632\u0631 \u0644\u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0636\u0648\u0626\u064a\u060c \u0648\u062a\u062d\u0631\u064a\u0631 \u0627\u0644\u0632\u0631 \u0644\u0625\u0646\u0647\u0627\u0621 \u0627\u0644\u0645\u0633\u062d. \u064a\u0646\u062a\u0647\u064a \u0627\u0644\u0628\u062d\u062b \u0639\u0646\u062f\u0645\u0627 \u064a\u0643\u0648\u0646 \u0627\u0644\u0641\u062d\u0635 \u0646\u0627\u062c\u062d\u0627\u064b \u0623\u0648 \u064a\u062a\u062c\u0627\u0648\u0632 \u0648\u0642\u062a \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0648\u0642\u062a \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0648\u0627\u062d\u062f\u0629.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
